	background: -webkit-linear-gradient(top, #51233d 0%,#223a66 55%,#136d67 100%);
	/* Chrome10-25,Safari5.1-6 */
	background: linear-gradient(to bottom, #51233d 0%,#223a66 55%,#136d67 100%);
	/* W3C, IE10+, FF16+, Chrome26+, Opera12+, Safari7+ */
}

.card-wrap {
	margin: 2rem auto;
	max-width:900px;
	word-wrap: break-word;
	text-align: center;
}

/* The center wrap */
.cardy {
	padding: 0.9em 0.9em;
	margin: 0.5em 10%;
	background-color: #030303;
	border-radius: 10px;
	text-align: center;
	box-shadow: 0px 7px 6px 0 rgba(33, 33, 33, 1);
	word-wrap: break-word;
}
.card-front {
	line-height: 1.7em;
	font-size: 1.2em;
	font-weight: 400;
	max-width: 900px;
margin: auto auto
}

.cardy img {
	display: inline-block ;
	margin: auto auto;
	max-height: 20rem;
}
.mobile .cardy img {
	max-width: 100%;
	max-height: none;
}
.mobile .cardy {
	margin: 0.1em 0.1em;
}
.mobile #content {
	margin: 0.1em 0.1em;
}
.question {
	border-radius: 7px 7px 7px 7px;
}
.answer {
	border-radius: 7px 7px 7px 7px;
}
hr {
	margin: 1em 3em 1em;
	padding: 0;
