    .mobile .resizer {min-width:100%!important;}

/*Image hover zoom*/
#extra img:hover { transform:scale(1.2); }
#myextra img:hover { transform:scale(1.2); }
#extrazanki img:hover { transform:scale(1.2); }
#firstaid img:hover { transform:scale(1.5); }
#sketchy img:hover { transform:scale(1.5); }
#lecture img:hover { transform:scale(1.5); }
#additional img:hover { transform:scale(1.5); }
.mobile #firstaid img:hover { transform:scale(1.0); }
.mobile #sketchy img:hover { transform:scale(1.0); }
.mobile #physeo img:hover { transform:scale(1.0); }
.mobile #additional img:hover { transform:scale(1.0); }

