.card, #tags-container {
	background-color: #333B45;
}
/* CLOZE FORMAT */
.cloze, .cloze b, .cloze u, .cloze i {
	font-weight: bold;
	color: MediumSeaGreen !important;
}
/* "EXTRA" FIELD COLOR */
#extra {
	color: magenta;
}
/* HINT COLOR*/
a[href="#"] {
	color: #4297F9!important;
}
/* HINT REVEAL COLOR */
.hints {
	color: #cyan;
}
/* Missed Questions Reveal Color */
#missed {
	color: red;
}


/* ~~NIGHT MODE COLORS~~ */

/* NM DEFAULT TEXT COLOR*/
.nightMode.card, .night_mode .card{
	color: #E0E5EE !important;
}
/* NM BACKGROUND COLOR*/
.nightMode.card, .night_mode .card, .nightMode #tags-container, .night_mode #tags-container{
	background-color: #002b36 !important;
}
/* NM CLOZE COLOR */
.nightMode .cloze, .night_mode .cloze {
	color: font-weight: bold;
	color: MediumSeaGreen !important;
}
/* NM "EXTRA" FIELD COLOR */
.nightMode #extra, .night_mode #extra {
	color: magenta;
}
/* NM HINT COLOR */
.nightMode a[href="#"], .night_mode a[href="#"] {
	color: #4297F9!important;
}
/* NM HINT REVEAL COLOR */
.nightMode .hints, .night_mode .hints {
	color: cyan;
}


/* COLOR ACCENTS FOR BOLD-ITALICS-UNDERLINE*/

b {
	color: #C695C6 !important;
}
u {
	text-decoration: none;
	color: #5EB3B3;
}
i {
	color: IndianRed;
}
a {
	color: LightGray !important;
	text-decoration: none;
	font-size: 10px;
	font-style: normal;
}


/* Details For IMAGES */

.mobile .cardy img {
	max-width: 100%!important;
	max-height: none ;
}
}
.mobile .cardy {
margin: 0.5ex 0em;
}
.cardy #extra img {
min-width: 40%!important;
}
.mobile .cardy #extra img, .mobile .cardy #lecture img, .mobile .cardy #missed img, .mobile .cardy #pathoma img, .mobile .cardy #extrazanki img, .mobile .cardy #firstaid img, .mobile .cardy #sketchy img, .mobile .cardy #physeo img, .mobile .cardy #additional img {
max-width: 100%!important;
max-height: none;
}
}

/* Adjustments For Cloze Edit In Review On Mobile */
.clozefield, .mobile .editcloze {
display: none;
