.editcloze, .mobile .clozefield {
display: block;
}

/* BEGIN HINT FIELDS */

/* Hint Link */
a[href="#"] {
font-style: italic;
padding: 0 !important;
}

/* Text When Hint Is Shown*/
.hints {
font-style: italic;
}

/* Put Bottom Hints Lower */
#firstaid {
padding-top: 1px!important;
}
.hints + #extra {
margin-top: .4rem;
}

/* END HINT FIELDS */

/* EXTRA FIELD */
#extra, #extra i {
font-size: 18px;
font-style: italic;
